import React from 'react';

import './Counter.css';

const Counter = () => {
  return (
    <div className="counter__section">
      <div className="container">
        <p className="counter__section_watt">
          2063<br />
          Zamontowanych<br />
          kilowatów
        </p>
        <hr />
        <p className="counter__section_install">
          206<br />
          Wykonanych<br />
          Instalacji
        </p>
        <hr />
        <p className="counter__section_client">
          870<br />
          Zadowolonych<br />
          Klientów
        </p>
      </div>
    </div>
  );
};
export default Counter;
